import React from 'react';

const MetadataDisplay = ({ metadata }) => {
  const { startTime, endTime, duration, date, keywords, names } = metadata;

  const formatTime = (time) => {
    return time ? new Date(time).toLocaleTimeString() : 'N/A';
  };

  const formatDate = (time) => {
    return time ? new Date(time).toLocaleDateString() : 'N/A';
  };

  const formatDuration = (duration) => {
    if (!duration) return 'N/A';
    const seconds = Math.floor(duration / 1000);
    return `${seconds} seconds`;
  };

  return (
    <div>
      <h2>Recording Metadata</h2>
      <p><strong>Date:</strong> {formatDate(date)}</p>
      <p><strong>Start Time:</strong> {formatTime(startTime)}</p>
      <p><strong>End Time:</strong> {formatTime(endTime)}</p>
      <p><strong>Duration:</strong> {formatDuration(duration)}</p>
      <p><strong>Names:</strong> {names && names.length > 0 ? names.join(', ') : 'N/A'}</p>
      <p><strong>Keywords:</strong> {keywords && keywords.length > 0 ? keywords.join(', ') : 'N/A'}</p>
    </div>
  );
};

export default MetadataDisplay;
